import React from "react";
import { useState } from "react";

class CurrentListingManager {
    constructor(apiUrl) {
        this.apiUrl = apiUrl;
    }

    RetrieveListings() {
        return fetch(`${this.apiUrl}/product/listAll`, {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
            },
        }).then(response => console.log(JSON.parse(response.body)))
        .catch(error => console.error('Error authenticatings', error));
    }
}
export default CurrentListingManager;
